import React from "react";
import { Grid, Input, TextField } from "@material-ui/core";

export default function MemberInput() {
  return (
    <>
      <Grid container spacing={1}>
        <Grid item xs={12}>
          <TextField
            id=""
            className="member-input"
            label="Personal invite Code"
            variant="filled"
          />
        </Grid>
      </Grid>
    </>
  );
}
